import React from 'react';
import logo from './images/logo.svg';
import {About, Portfolio, Contact} from './components';
import './App.css';
import Zoom from 'react-reveal/Zoom';




function App() {

  return (
    <div>
    <Zoom>
        <header className="header">
          <div className="logo">
            <img src={logo}  alt="logo" />
          </div>
        </header>
    </Zoom>
    <Zoom>
      <About/>
    </Zoom>
    <Zoom>
      <Portfolio/>
    </Zoom>
    <Zoom>
      <Contact/>
    </Zoom>
    </div>
  );
}

export default App;
